script: |
  super -f text -I q11274.spq | sort > q11274.out

inputs:
  - name: q11274.spq
    data: |
      SELECT col2 FROM tab1 (FORMAT parquet) WHERE NOT ( + ( - + col0 ) * + + ( + col2 ) * - - col0 + + 8 + + col2 ) > 24;
  - name: tab1

outputs:
  - name: q11274.out
    data: |
      59
      68
      96
